import React from 'react';
import Logo from '../../assets/Perro.png';
import mercadopago from '../../assets/mercadopago.png';
import comprasegura from '../../assets/comprasegura.jpeg';
import afip from '../../assets/afip.png';
import './footer.css';
const Footer = () => {
    return (
        <>
            <div className="container__subfooter py-2">
                <div className="container d-flex">
                    <div className="redes__footer">
                        <i className="fab fa-facebook-f iconos__footer"></i>
                        <i className="fab fa-instagram iconos__footer"></i>
                        <img src={mercadopago} alt="mercado pago"/>
                        <img src={comprasegura} alt="compra segura"/>
                        <img src={afip} alt="afip" width="25px"/>
                    </div>
                    <div className="legales__footer">
                        <ul>
                            <li><a href="/">Terminos y condiciones</a></li>
                            <li><a href="/">Pol√≠ticas de privacidad</a></li>
                        </ul>
                    </div>
                </div>
            </div>
            <footer className="bg-yellow">
                <div className="container d-flex align-items-center justify-content-between py-2">
                    <span className="text-bold">Copyright &copy; 2020 oliverpetshop.com.ar. Todos los derechos reservados</span>
                    <img src={Logo} alt="Oliver" width="50px" height="50px"/>
                </div>
            </footer>
        </>
    );
}

export default Footer;
